const Bootstrap = require('../bootstrap');
const fixtureHtml = require('./fixture/2017-08-29.html');
global.$ = require('jquery');

test('test getBasicParams struct', () => {
    let cs = '', ti = '', chs = '', expected = {cs, ti, chs}, bootstrap = new Bootstrap();
    expect(bootstrap.getBasicParams('')).toMatchObject(expected);
});
test('test getBasicParams values', () => {
    let cs = '',
        ti = '3654',
        chs = '545', expected = {cs, ti, chs},
        bootstrap = new Bootstrap();
    expect(bootstrap.getBasicParams(fixtureHtml)).toMatchObject(expected);
});
